insert into individual_calidad_2019 select 'A)Muerte mat. sin fecha de defuncion....................' as error, a.* from individual a where ano = xano and (diagnostic = "O95" or diagnostic = "O96" or diagnostic = "O97") and fecha_def is null;
insert into individual_calidad_2019 select 'F)Semana no corresp. con fecha de inic..................' as error, a.* from individual a where ano = xano and semana <> week(fecha_ini,6) and diagnostic in (select cie_10 from diagno where diresa = "00");
insert into individual_calidad_2019 select 'G)Error en tipo de diagnóstico..........................' as error, a.* from individual a where ano = xano and tipo_dx not in (select codigo from tipo_dx) and diagnostic in (select cie_10 from diagno where diresa = "00");
insert into individual_calidad_2019 select 'B)Establecimiento no existe en nuestra BD...............' as error, a.* from individual a where ano = xano and e_salud not in (select cod_est from renace);
insert into individual_calidad_2019 select 'H)Código de ubigeo no existe............................' as error, a.* from individual a where ano = xano and ubigeo <> "999999" and ubigeo not in (select ubigeo from codubi where ano = xano) and diagnostic in (select cie_10 from diagno where diresa = "00");
insert into individual_calidad_2019 select 'C)Muerte mat. fecha de inic. y fecha de def. diferentes.' as error, a.* from individual a where ano = xano and (diagnostic = "O95" or diagnostic = "O96" or diagnostic = "O97") and fecha_ini <> fecha_def and fecha_def is not null;
insert into individual_calidad_2019 select 'I)Tipo de edad no corresponde a la edad.................' as error, a.* from individual a where ano = xano and ((tipo_edad = "M" and edad > 12) or (tipo_edad = "D" and edad > 31)) and diagnostic in (select cie_10 from diagno where diresa = "00") and registroId not in (select registroId from individual_calidad);
insert into individual_calidad_2019 select 'D)Muerte materna en hombre..............................' as error, a.* from individual a where ano = xano and (diagnostic = "O95" or diagnostic = "O96" or diagnostic = "O97") and sexo = "M";
insert into individual_calidad_2019 select 'E)Muerte materna en menor de edad.......................' as error, a.* from individual a where ano = xano and (diagnostic = "O95" or diagnostic = "O96" or diagnostic = "O97") and (tipo_edad <> "A" or edad < 12);
insert into individual_calidad_2019 select 'J)Fecha de inicio superior a la actual..................' as error, a.* from individual a where ano = xano and fecha_ini > date(now()) and diagnostic in (select cie_10 from diagno where diresa = "00");
insert into individual_calidad_2019 select 'K)Fecha de inicio superior a la fecha de notif..........' as error, a.* from individual a where ano = xano and fecha_ini > fecha_not and diagnostic in (select cie_10 from diagno where diresa = "00");
insert into individual_calidad_2019 select 'L)Parálisis flácida en mayor de 15 años.................' as error, a.* from individual a where ano = xano and diagnostic = "A80.3" and edad > 15 and tipo_edad = "A";
