DROP PROCEDURE IF EXISTS `spr_indicadores_monitoreo`$$
CREATE DEFINER=`root`@`localhost` PROCEDURE `spr_indicadores_monitoreo` (`xano` INT(4), `xsemana` INT(2), `xfecha` VARCHAR(10))  BEGIN

select a.nombre, if(b.fecha < xfecha or (b.fecha = xfecha and b.hora <= '14:00:00'), 1, 0) as oportunidad, '8' as integralidad, if(c.cobertura >= 1, 1, c.cobertura) as cobertura, d.calidad1, d.calidad2,

'1' as seguimiento, '1' as regularizacion, i.boletin as retroinformacion

from diresas a

left join

(select diresa, fecha, hora from autoriza where ano = xano and semana = xsemana) b

on a.codigo = b.diresa

left join

(select a.diresa, a.eess, b.notifican, round(((b.notifican / a.eess) * 100) / 100,2) as cobertura

from

(select subregion as diresa, count(*) as eess from renace where notifica = 'S' and estado = '1' group by subregion order by subregion) a

left join

(select diresa, count(*) as notifican from notiweb.cobertura where ano = xano and semana = xsemana and (notificacion = 1 or notificacion = 2) group by diresa) b

on a.diresa = b.diresa) c

on a.codigo = c.diresa

left join

(select a.codigo, if(b.puntos > 0 or c.puntos > 0, 0, 1) as calidad1, if(e.puntos > 0, 0, 1) as calidad2

from diresas a

left join

(select sub_reg_nt, count(*) as puntos from edas_control_calidad_2019 group by sub_reg_nt) b

on a.codigo = b.sub_reg_nt

left join

(select sub_reg_nt, count(*) as puntos from iras_control_calidad_2019 group by sub_reg_nt) c

on a.codigo = c.sub_reg_nt

left join

(select sub_reg_nt, count(*) as puntos from individual_calidad_2019 group by sub_reg_nt) e

on a.codigo = e.sub_reg_nt

group by a.codigo) d

on a.codigo = d.codigo

left join

(select a.codigo, IF(b.boletin > 0, 1, 0) as boletin

from diresas a

left join

(select diresa, count(*) as boletin from boletin_semanal

where ruta <> '' and (anio = xano and semana = xsemana-1) or (anio = xano and (semana = xsemana and week(fecha_reg) = xsemana))

group by diresa) b

on a.codigo = b.diresa

where a.codigo <> '77'

order by a.codigo) i

on a.codigo = i.codigo

where a.codigo <> "77"

group by a.nombre

order by a.nombre;

END$$

DROP PROCEDURE IF EXISTS `spr_usuarios_vih`$$
CREATE DEFINER=`root`@`localhost` PROCEDURE `spr_usuarios_vih` ()  BEGIN

SELECT nombres, damedisa(diresa) as diresa, damered(diresa,red) as red, damemicrored(diresa, red, microred) as microred,

dameeess(establecimiento) as establecimiento, dameNivelUsuario(nivel) as nivel, b.*, c.nombre as estado, email, celular, registro

FROM `usuarios_frontend` a

left join

(select x.usuario,

group_concat(if(x.aplicacion = '2', 'si', null)) as sifilis_mater_congenita,

group_concat(if(x.aplicacion = '2' and grabar = '1', '1', null)) as grabar_smc,

group_concat(if(x.aplicacion = '2' and modificar = '1', '1', null)) as modificar_smc,

group_concat(if(x.aplicacion = '2' and ver = '1', '1', null)) as ver_smc,

group_concat(if(x.aplicacion = '2' and eliminar = '1', '1', null)) as eliminar_smc,

group_concat(if(x.aplicacion = '2' and descargar = '1', '1', null)) as descargar_smc,

group_concat(if(x.aplicacion = '6', 'si', null)) as vih_sida,

group_concat(if(x.aplicacion = '6' and grabar = '1', '1', null)) as grabar_vih,

group_concat(if(x.aplicacion = '6' and modificar = '1', '1', null)) as modificar_vih,

group_concat(if(x.aplicacion = '6' and ver = '1', '1', null)) as ver_vih,

group_concat(if(x.aplicacion = '6' and eliminar = '1', '1', null)) as eliminar_vih,

group_concat(if(x.aplicacion = '6' and descargar = '1', '1', null)) as descargar_vih,

group_concat(if(x.aplicacion = '19', 'si', null)) as sifilis_gonorrea,

group_concat(if(x.aplicacion = '19' and grabar = '1', '1', null)) as grabar_sg,

group_concat(if(x.aplicacion = '19' and modificar = '1', '1', null)) as modificar_sg,

group_concat(if(x.aplicacion = '19' and ver = '1', '1', null)) as ver_sg,

group_concat(if(x.aplicacion = '19' and eliminar = '1', '1', null)) as eliminar_sg,

group_concat(if(x.aplicacion = '19' and descargar = '1', '1', null)) as descargar_sg

from

(SELECT aplicacion, usuario, grabar, modificar, ver, eliminar, descargar, estado FROM tablaccesos where aplicacion = '2' or aplicacion = '6' or aplicacion = '19') x

group by x.usuario) b on a.usuario = b.usuario

left join motivos c on a.estado = c.codigo

where b.sifilis_mater_congenita = 'si' or vih_sida = 'si' or sifilis_gonorrea = 'si'

order by diresa, red, microred, establecimiento;

END$$

