CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_genera_incidencia_edas` (`xconstante` INT(10))  BEGIN

select x.ubigeo,

round(ifnull(a.cantidad, 0) / x.pobtot * xconstante,4) as '2007',

round(ifnull(b.cantidad, 0) / x.pobtot * xconstante,4) as '2008',

round(ifnull(c.cantidad, 0) / x.pobtot * xconstante,4) as '2009',

