left join

(select ubigeo, sum(daa_c1+daa_c1_4+daa_c5+dis_c1+dis_c1_4+dis_c5) as cantidad

from edas_ant

where ano = YEAR(curdate()) - 5 and semana <= WEEK(curdate()) - 1

group by ubigeo) f

on x.ubigeo = f.ubigeo

left join

(select ubigeo, sum(daa_c1+daa_c1_4+daa_c5+dis_c1+dis_c1_4+dis_c5) as cantidad

from edas_ant

where ano = YEAR(curdate()) - 4 and semana <= WEEK(curdate()) - 1

group by ubigeo) g

on x.ubigeo = g.ubigeo

left join

(select ubigeo, sum(daa_c1+daa_c1_4+daa_c5+dis_c1+dis_c1_4+dis_c5) as cantidad

from edas_ant

where ano = YEAR(curdate()) - 3 and semana <= WEEK(curdate()) - 1

group by ubigeo) h

on x.ubigeo = h.ubigeo

left join

(select ubigeo, sum(daa_c1+daa_c1_4+daa_c5+dis_c1+dis_c1_4+dis_c5) as cantidad

