DROP PROCEDURE IF EXISTS `usp_edas_calidad`$$
CREATE DEFINER=`root`@`localhost` PROCEDURE `usp_edas_calidad` (`xano` INT(4))  BEGIN



DROP TABLE IF EXISTS `edas_control_calidad_2019`;

create table edas_control_calidad_2019



SELECT  'Duplicado total' as error,e.*

FROM edas as e

INNER JOIN (

	SELECT ano, semana, sub_reg_nt, red, microred, e_salud, ubigeo, daa_c1, daa_c1_4, daa_c5, daa_d1, daa_d1_4, daa_d5, dis_c1, dis_c1_4, dis_c5, dis_d1, dis_d1_4, dis_d5, daa_h1, daa_h1_4, daa_h5, dis_h1, dis_h1_4, dis_h5, clave, migrado, verifica, etapa, estado, etniaproc, etnias, procede, otroproc,

	COUNT(*)

	FROM edas where ano=xano

	GROUP BY ano, semana, sub_reg_nt, red, microred, e_salud, ubigeo, daa_c1, daa_c1_4, daa_c5, daa_d1, daa_d1_4, daa_d5, dis_c1, dis_c1_4, dis_c5, dis_d1, dis_d1_4, dis_d5, daa_h1, daa_h1_4, daa_h5, dis_h1, dis_h1_4, dis_h5, clave, migrado, verifica, etapa, estado, etniaproc, etnias, procede, otroproc

	HAVING COUNT(*) > 1) as edas2

ON 	edas2.clave = e.clave

union all





SELECT  'Duplicado parcial' as error,edas.*

FROM edas

INNER JOIN (

	SELECT registroId, ubigeo, etniaproc, etnias, procede, otroproc, ano, semana, e_salud,  COUNT(*)

	FROM edas where ano=xano

	GROUP BY ubigeo, etniaproc, etnias, procede, otroproc, ano, semana, e_salud

	HAVING COUNT(*) > 1) as edas2

ON 	edas2.ubigeo = edas.ubigeo

	AND edas2.etniaproc = edas.etniaproc

	AND edas2.etnias = edas.etnias

	AND edas2.etnias = edas.etnias

	AND edas2.procede = edas.procede

	AND edas2.otroproc = edas.otroproc

	AND edas2.ano = edas.ano

	AND edas2.semana = edas.semana

	AND edas2.e_salud = edas.e_salud

order by error,e_salud;





