delete from indicadores where anio = xano and semana = xsemana;


(select '', x.anio, x.semana, x.diresa, x.oportunidad, x.cobertura, x.calidad, x.seguimiento, x.regularizacion, x.retroinformacion,

round(((oportunidad*0.15)+(cobertura*0.20)+(calidad*0.30)+(seguimiento*0.10)+(regularizacion*0.10)+(retroinformacion*0.15)),2) as total,

x.individual, x.edas, x.iras

from

(SELECT anio, semana, diresa,

round((oportunidad*50)+((integralidad/8) * 50),2) as oportunidad,

round(format(cobertura,2)*100, 2) as cobertura,

round(format(30+((duplicados*35)+(inconsistencias*35)),2),2) as calidad,

case

 when seguimiento = 0 then 30.00

 else seguimiento * 100

end as seguimiento,

case

 when regularizacion = 0 then 30.00

 else regularizacion * 100

end as regularizacion,

case

 when retroinformacion = 0 then 30.00

 else retroinformacion * 100

end as retroinformacion,

individual, edas, iras

FROM resultados

WHERE anio = xano and semana = xsemana and estado = '1'

group by diresa) x

group by x.anio, x.semana, x.diresa);

