CREATE DEFINER=`root`@`localhost` PROCEDURE `usp_individual_calidad_malaria` (`p_dx` VARCHAR(5))  BEGIN

-- Variables donde almacenar lo que nos traemos desde el SELECT

  DECLARE v_registroId int;

  DECLARE v_semana int;

  DECLARE v_diagnostic char(5);

  DECLARE v_apepat char(50);

  DECLARE v_apemat char(50);

  DECLARE v_nombres char(50);

  DECLARE v_llave char(50);

  DECLARE v_llave_ini char(50) default '';

  DECLARE v_semana_ini int DEFAULT 0;

  DECLARE v_flag_ini int DEFAULT 0;

  DECLARE v_registroId_ini int DEFAULT 0;









-- Variable para controlar el fin del bucle

  DECLARE fin INTEGER DEFAULT 0;



-- El SELECT que vamos a ejecutar



DECLARE runners_cursor CURSOR FOR

SELECT

registroId,  semana, diagnostic,apepat, apemat, nombres ,concat(left(apepat,3), left(apemat,3), left(nombres,3))as llave

 FROM individual i where ano = year(curdate()) and diagnostic=p_dx and concat(left(apepat,3), left(apemat,3), left(nombres,3)) in(SELECT

concat(left(apepat,3), left(apemat,3), left(nombres,3))

 FROM individual i where ano = year(curdate()) and diagnostic=p_dx  group by concat(left(apepat,3), left(apemat,3), left(nombres,3)) having count(*)>1) order by llave,semana desc;





-- Condición de salida

  DECLARE CONTINUE HANDLER FOR NOT FOUND SET fin=1;



  OPEN runners_cursor;

  get_runners: LOOP

    FETCH runners_cursor INTO v_registroId,v_semana,v_diagnostic,v_apepat,v_apemat,v_nombres ,v_llave;

    IF fin = 1 THEN

       LEAVE get_runners;

    END IF;





    IF v_flag_ini>0 and v_llave_ini=v_llave  and v_semana_ini - v_semana <4 THEN

--       IF v_semana_ini - v_semana <4 and v_llave_ini=v_llave and v_semana_ini<>0 THEN



          -- insert into test_cursor_2 select  v_semana_ini ,v_semana,(v_semana_ini - v_semana) as total,v_llave,v_registroId_ini,v_registroId;


          and registroId not in (select registroId from individual_calidad);







  --    END IF;

    END IF;





    set v_flag_ini=1;

    set v_semana_ini=v_semana;

    set v_registroId_ini=v_registroId;



    IF v_llave_ini<>v_llave THEN

        set v_llave_ini=v_llave;





    END IF;







  END LOOP get_runners;

  CLOSE runners_cursor;

END$$

