DROP PROCEDURE IF EXISTS `usp_iras_calidad`$$
CREATE DEFINER=`root`@`localhost` PROCEDURE `usp_iras_calidad` (`xano` INT(4))  BEGIN

/*insert into procesos values('iras_duplicados_parciales',now());*/

DROP TABLE IF EXISTS `iras_control_calidad_2019`;

create table iras_control_calidad_2019

SELECT  'Duplicado total' as error,i.*

FROM iras as i

INNER JOIN (

	SELECT registroId, ubigeo, etniaproc, etnias, procede, otroproc, ano, semana, e_salud,  COUNT(*)

	FROM iras where ano=xano

	GROUP BY ubigeo, etniaproc, etnias, procede, otroproc, ano, semana, e_salud

	HAVING COUNT(*) > 1) as si

ON 	si.ubigeo = i.ubigeo

	AND si.etniaproc = i.etniaproc

	AND si.etnias = i.etnias

	AND si.etnias = i.etnias

	AND si.procede = i.procede

	AND si.otroproc = i.otroproc

	AND si.ano = i.ano

	AND si.semana = i.semana

	AND si.e_salud = i.e_salud



union all





SELECT 'Duplicado parcial' as error,i.*

FROM iras as i

INNER JOIN (

	SELECT ano, semana, sub_reg_nt, red, microred, e_salud, ubigeo, ira_m2, ira_2_11, ira_1_4a, neu_2_11, neu_1_4a, hos_m2, hos_2_11, hos_1_4a, ngr_m2, ngr_2_11, ngr_1_4a, dih_m2, dih_2_11, dih_1_4a, deh_m2, deh_2_11, deh_1_4a, sob_2a, sob_2_4a, fecha_ing, clave, migrado, verifica, etapa, ira_5_9a, ira_10_19a, ira_20_59a, ira_60a, neu_5_9a, neu_60a, hos_5_9a, hos_60a, ngr_5_9a, ngr_60a, dih_5_9a, dih_60a, deh_5_9a, deh_60a, sob_5_9a, sob_10_19a, sob_20_59a, sob_60a, estado, localcod, neu_10_19, neu_20_59, hos_10_19, hos_20_59, dih_10_19, dih_20_59, deh_10_19, deh_20_59, etniaproc, etnias, procede, otroproc,

	COUNT(*)

	FROM iras where ano=xano

	GROUP BY ano, semana, sub_reg_nt, red, microred, e_salud, ubigeo, ira_m2, ira_2_11, ira_1_4a, neu_2_11, neu_1_4a, hos_m2, hos_2_11, hos_1_4a, ngr_m2, ngr_2_11, ngr_1_4a, dih_m2, dih_2_11, dih_1_4a, deh_m2, deh_2_11, deh_1_4a, sob_2a, sob_2_4a, fecha_ing, clave, migrado, verifica, etapa, ira_5_9a, ira_10_19a, ira_20_59a, ira_60a, neu_5_9a, neu_60a, hos_5_9a, hos_60a, ngr_5_9a, ngr_60a, dih_5_9a, dih_60a, deh_5_9a, deh_60a, sob_5_9a, sob_10_19a, sob_20_59a, sob_60a, estado, localcod, neu_10_19, neu_20_59, hos_10_19, hos_20_59, dih_10_19, dih_20_59, deh_10_19, deh_20_59, etniaproc, etnias, procede, otroproc

	HAVING COUNT(*) > 1) as si

ON 	si.clave = i.clave



ORDER BY error,e_salud;





-- Iras sin duplicados

-- =========================================================

/*insert into procesos values('iras_sin_duplicados',now());*/

