sum(neu_2_11+neu_1_4a+ngr_m2+ngr_2_11+ngr_1_4a) neumonias_menores_5,

sum(neu_5_9a+neu_10_19+neu_20_59+neu_60a) as neumonias_mayores_5,

sum(hos_m2+hos_2_11+hos_1_4a) as hospitalizados_menores_5,

sum(dih_m2+dih_2_11+dih_1_4a) as defunciones_ih_menores_5,

sum(dih_5_9a+dih_10_19+dih_20_59+dih_60a) as defunciones_ih_mayores_5,

sum(deh_m2+deh_2_11+deh_1_4a) as defunciones_eh_menores_5,

sum(deh_5_9a+deh_10_19+deh_20_59+deh_60a) as defunciones_eh_mayores_5,

sum(sob_2a+sob_2_4a) as sob_asma_menores_5

from iras where ano = xano

group by ano, semana, ubigeo, sub_reg_nt, red, microred, e_salud;

END$$

DROP PROCEDURE IF EXISTS `usp_iras_redes`$$
CREATE DEFINER=`root`@`localhost` PROCEDURE `usp_iras_redes` (`xano` INT(4), `xdiresa` VARCHAR(2), `xredes` VARCHAR(2))  BEGIN

select registroId, ano, semana, dameDist(ubigeo) as distrito, ubigeo, damedisa(sub_reg_nt) as sub_reg_nt,

damered(sub_reg_nt,red) as red, damemicrored(sub_reg_nt,red, microred) as microred,

dameeess(e_salud) as establecimiento, e_salud,

ira_m2, ira_2_11, ira_1_4a,

ira_5_9a, ira_10_19a, ira_20_59a, ira_60a,

neu_2_11, neu_1_4a,

neu_5_9a, neu_60a,

ngr_m2, ngr_2_11, ngr_1_4a,

ngr_5_9a, ngr_60a,

hos_m2, hos_2_11, hos_1_4a,

hos_5_9a, hos_10_19, hos_20_59, hos_60a,

dih_m2, dih_2_11, dih_1_4a,

dih_5_9a, dih_10_19, dih_20_59, dih_60a,

deh_m2, deh_2_11, deh_1_4a,

deh_5_9a, deh_10_19, deh_20_59, deh_60a,

sob_2a, sob_2_4a, sob_5_9a, sob_10_19a, sob_20_59a, sob_60a,

fecha_ing,etniaproc, etnias, procede, otroproc, usuario

from iras where ano = xano and sub_reg_nt = xdiresa and red = xredes;

END$$

