DROP FUNCTION IF EXISTS `dameDiagno`$$
CREATE DEFINER=`root`@`localhost` FUNCTION `dameDiagno` (`cod` VARCHAR(5), `eda` INT(3), `teda` VARCHAR(1)) RETURNS INT(11) BEGIN

declare respuesta int;

select

case

  when (cod = "O95" and cie_10 = cod and eda < 11) or (cod = "O95" and cie_10 = cod and (teda = "D" or teda = "M")) then 0

  when cod = "Q02" and cie_10 = cod and teda = "A" then 0

  when cod = "A33" and cie_10 = cod and teda <> "D" then 0

  when cod = "A17" and cie_10 = cod and edad > 5 and teda = "A" then 0

  when cod = "A39.0" and cie_10 = cod and edad > 5 and teda = "A" then 0

  when cod = "A50" and cie_10 = cod and edad > 5 and teda = "A" then 0

  when cod = "A80.3" and cie_10 = cod and edad > 14 and teda = "A" then 0

  when cod = "P35.0" and cie_10 = cod and edad > 1 and teda = "A" then 0

  when cod = "P35.C" and cie_10 = cod and edad > 1 and teda = "A" then 0

  when cod = "Z20.6" and cie_10 = cod and edad > 2 and teda = "A" then 0

  when (cod = "U06G" and cie_10 = cod and eda > 50 and teda = "A") or (cod = "U06G" and cie_10 = cod and (teda = "D" or teda = "M")) then 0

  when (cod = "U06AG" and cie_10 = cod and eda > 50 and teda = "A") or (cod = "U06AG" and cie_10 = cod and (teda = "D" or teda = "M")) then 0

  else 1

end

as resultado into respuesta

from diagno where cie_10 = cod limit 1;

return respuesta;

END$$

